import React from 'react';
import '../styles/app.css'
import linkedinLogo from "../assets/linkedin-logo.png" 
import githubLogo from "../assets/github-logo.png"

function Home(){
    return (
        <div className = 'home'>
            <p> Hey, it's Ahmed Alamin! </p>

        <div className = 'logos'>
            <a href = "https://www.linkedin.com/in/ahmedalaminn" target="_blank" rel="noopener noreferrer"> <img src = {linkedinLogo}/> </a>
            <a href = "https://github.com/ahmedalaminn" target="_blank" rel="noopener noreferrer"> <img src = {githubLogo}/> </a>
        </div>
        </div> 
    );
}

export default Home;
